iamamiwhoami is an electronic music project featuring a female vocalist and unknown producers. It was promoted through a viral campaign onOn 4 December 2009, a surreal clip less than a minute long appeared onsubmitted by iamamiwhoami. The clip was forwarded to several known blogger as well as music journalists. A second soon appeared and then a third. By then, Chris Cantalini and MTV writer James Montgomery picked up on the clips fueling speculation that had been building in blogs.

